Express res.render not working after res.writeHead<p>I am making a simple site that tells the user how many times they have visited the site. I also must be able to report out all users and their number of visits. I must accomplish this by using cookies, and cannot use any of the NPM modules. My plan is to use cookies to record the number of visits, and push that to MongoDB so I can report across all users.</p>
<p>I'm currently running into an issue where <code>res.render</code> is not working for me. I am trying to serve a view (pug). Can anyone explain why this is? I am getting the error: <em>Error [ERR_HTTP_HEADERS_SENT]: Cannot set headers after they are sent to the client</em></p>
<p>Here is a simplified version of my code. In the full version, I have some logic to read the cookies, increment <code>timesSeen</code>, and display <code>timesSeen</code> for returning users.</p>
<pre><code>router.get(&quot;/&quot;, function (req, res, next) {
  // Create a new instance of a user and save to mongoDB
  var newUser = new User();
  newUser
    .save()
    .then((newUser) =&gt; {
      // Once the user is saved, set the cookies to match
      res.writeHead(200, {
        &quot;Set-Cookie&quot;: [
          `userID=${newUser._id}`,
          &quot;timesSeen=0&quot;,
        ],
      });
      res.render(&quot;index&quot;, {
        title: &quot;Express&quot;,
        userID: newUser._id,
        timesSeen: 0
      });
      res.end();
    })
      .catch((err) =&gt; {
        if (err) {
          console.log(err);
          return;
        }
      });
} 
</code></pre>

