Managing relationships with MongoDb in a Microservices architecture<p>I've been working with microservices for some time now, always with relational databases. I am looking at MongoDb and I am not sure how to handle entity relationships involving different microservices. Here goes an example:</p>
<pre><code>public class Employee implements Serializable {
   private String id;
   ...
}

public class Department implements Serializable {
    private String id;
    private String desc;
    private List&lt;Employee&gt; employees = new ArrayList&lt;&gt;();
    ...
}
</code></pre>
<p>These two entities are managed by two different microservices, with a one-to-many relationship managed by the <code>Department</code> entity. So far, so good.</p>
<p>With a relational database (being an optional relationship and with the possibility of one employee belonging to several departments) I'd map this in the <code>Departments</code> microservice with one table containing two fields: <code>employee_id</code> and <code>department_id</code>. When the client calls <code>getDepartmentWithEmployees(depId)</code> this microservice will read the table and obtain the proper employees from the <code>Employees</code> microservice.</p>
<p>But, in a MongoDb database, as far as I know, when I store a <code>Department</code> object it stores all associated <code>Employee</code>s. Is not that duplicating the information? Is there a way, maybe, where MongoDb don't store all info about the employees but just their id? Or there is another answer?</p>
<p>I am pretty sure this is a very basic question, but I am new to all this stuff.</p>
<p>Thanks in advance.</p>

